お取り寄せ商品ですので、納期が２～４営業日かかります。<br>お急ぎの場合は、カード決済していただければ、メーカーから直送が可能です。<br><br>用途　<br>●木質フロアーの床貼り<br>●各種暖房パネルの接着<br>●乾式遮音二重木質床材の接着<br>●木質系および複合木質系フローリング材とモルタル・コンクリート下地の接着に。<br>●床暖房用木質床材の接着に。<br><br>特長<br>湿気硬化型、耐熱性、耐水性、床鳴防止、健康住宅対応<br>■耐水性・耐熱性・耐油性に優れ、各種床材を確実に固定でき、床鳴りを防止します。<br>■Sは夏用でWが冬用です。<br><!--ここから楽太郎-->
