つやを与え、指先を美しく見せる、爪・指先用美容液です。<br>ジェルが美容オイルに変化するから、すばやく広がり、外出先でも液だれの心配がありません。<br>森林にいるような、心やすらぐアロマの香調。2種の植物オイル配合。<br>※ベニバナオイル・オリーブオイル(つや)<br><br>【使用方法】<br>●直接、爪のまわりに適量をだし、くるくるとマッサージするようになじませます。<br><br>【使用上の注意】<br>◇ご使用後は容器の口もとをキレイにふき、必ずキャップをきちんと閉めてください。<br>◇日のあたるところや高温・多湿のところにおかないでください。<br>◇チューブの口もとからまれに透明な油分が出てくることがありますが、品質上問題ありませんのでそのままお使いください。<br><br><br>【広告文責】株式会社ワンステップ<br>TEL：0570-550-860<br>【メーカー名】資生堂ジャパン株式会社<br>【区分】日本製・化粧品<br><br>▼お届地域について<br>商品の配送区域は、日本国内に限らせて頂きます。<br>海外への発送は承っておりませんので、あらかじめご了承くださいませ。<br>※商品の性質などにより、一部お届け地域を制限させていただいている場合もございます。くわしくは各商品詳細画面にてご確認下さい。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：資生堂<br>シリーズ名：インテグレート<br>種類別名称：ネールケア<br>原産国：日本<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><img src=http://image.rakuten.co.jp/onestep/cabinet/life/cosme03/shiseido.jpg width=150><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4901872055180 KS2073 ks2073 資生堂 しせいどう シセイドウ SHISEIDO shiseido INTEGRATE integrate インテグレート 化粧品 ネイル ネイル用品 ネイルグッズ 爪 つめ ツメ ポケットネールセラム ポケットネイルセラム ツヤ 艶 つや 指先 美容液 ジェル オイル アロマ マッサージ</font></td></tr></table><style type="text/css">
